// NotFound.js
import React from 'react';
import './NotFound.css';

const NotFound = () => {
  const notFoundImg = '../public'; // Путь к изображению Not Found
  return (
    <div className="not-found-container">
      <p className="not-found-text">Not Found</p>
      <img className="not-found-image" src={notFoundImg} alt="Not Found" />
    </div>
  );
}

export default NotFound;
